import { AMOUNT_ASSERT, SCORE_USER } from '.';

export const userScore = (payload) => ({
  type: SCORE_USER,
  payload,
});

export const amountAssert = (payload) => ({
  type: AMOUNT_ASSERT,
  payload,
});
